import React from 'react';
import styles from './NotificationCount.module.css';
import RoundWrapper from './Util/RoundWrapper';

export default function NotificationCount(props) {
    return (
        <div className={styles.notification_count}>
            <RoundWrapper diameter='40px' bgcolor='#5BB7ED' color='white'>
                <div>3</div>
            </RoundWrapper>
        </div>
    )
}
